  \"Physical, profile and underway data collected aboard the ROGER REVELLE during
  cruise RR1016 in the Philippine Sea and South China Sea (Nan Hai) from 2010-11-06
  to 2010-11-24 (NODC Accession 0089643)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:15:55.860462\",\n\t\"name\": \"physical-profile-and-underway-data-collected-aboard-the-roger-revelle-during-cruise-rr1016\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0089643 includes physical,
  profile and underway data collected aboard the ROGER REVELLE during cruise RR1016
  in the Philippine Sea and South China Sea (Nan Hai) from 2010-11-06 to 2010-11-24.
  These data include CONDUCTIVITY, CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT
  SPEED - NORTH/SOUTH COMPONENT (V), SALINITY and WATER TEMPERATURE. The instruments
  used to collect these data include ADCP, CTD and GPS. These data were collected
  by Ren-Chieh Lien of University of Washington, and by University of California -
  San Diego; Scripps Institution of Oceanography as part of Process Study of Oceanic
  Responses to Typhoons using Arrays of EM-APEX Floats and Moorings. The Lamont-Doherty
  Earth Observatory (LDEO) submitted these data to NODC as part of the NSF sponsored
  Rolling Deck to Repository (R2R) program.The ADCP data represent the raw and automated
  processed data set. Post processed quality assessed data are not available in this
  accession.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
